   function mac(handle_MAC)
    local lineHTML = ''
    local lineCSV = ''
    if handle_CLAP ~= nil then
     for _ in handle_MAC:lines() do
       --s = handle_MAC:read("*l")
       s = _
     
       if _ == nil then 
         handle_MAC:close() 
         else
        
           if s ~= nil then 
             AU_Manufacturer,AU_Name,AU_Inst = s:match("^(.+): (.+)=(.+)$")
           end
     
           if AU_Manufacturer ~= nil and AU_Name ~= nil then
             if AU_Inst == '<inst>' then 
                 class = 'installed' 
                 AU_InstCSV = 'INSTALLED' 
               else 
                 class = 'notinstalled' 
                 AU_InstCSV= 'NOT INSTALLED' 
             end
             lineHTML = lineHTML..'<tr><td><input type="checkbox" name="checkfield'..n..'" class="checkbox"></td><td class="name">'..n..' - MAC AU - '..AU_Name..' ('..AU_Manufacturer..')</td><td class="file centertext '..class..'">'..AU_InstCSV..'</td></tr>\n'
             lineCSV = lineCSV..','..n..',MAC AU - '..AU_Name..' ('..AU_Manufacturer..'),'..AU_InstCSV..'\n' 
             n=n+1
           end -- if 3
       end -- if 2
    end -- for
    handle_MAC:close()
  end -- if 1
    HTML:write(lineHTML)
    CSV:write(lineCSV)
  end -- function
  
  function InterHEADAER()
    local IntermediateHTML = '<tr><th class="table_header" colspan="3">MAC "AU PLUGINS"</th></tr>'
    local IntermediateCSV = '\nMAC "AU PLUGINS"\nCHECk,N.,NAME (Manufacturer),INSTALLED / NOT INSTALLED\n'
    HTML:write(IntermediateHTML)
    CSV:write(IntermediateCSV)
  end
  
  all()
   
  if getOS().os == "m" then 
    local handle_MAC = io.open(path_MAC, "r")
    if handle_MAC ~= nil then
      InterHEADAER()
      mac(handle_MAC)
    else
      reaper.MB("Not existing cache. Install at least 1 plugin!!!", "ERROR" ,0)
      return
    end
  end
  HTML:write(FooterHTML)
  HTML:close()
  CSV:close()
  
  ---------------------------------------------
  -- USER INFO
  ---------------------------------------------
  VST_RegisterHTML = string.gsub(VST_RegisterHTML, '/', getOS().slash)
  VST_RegisterCSV = string.gsub(VST_RegisterCSV, '/', getOS().slash)
  local sucessfulStrig = "The HTML and CSV files are saved into the main folder of Reaper\n\n"..VST_RegisterHTML..'\n'..VST_RegisterCSV
  reaper.MB(sucessfulStrig, "HTML & CSV: Succesfuly Saved",0)
end
main()
